@media screen and (max-width: 767px) {
    .overlay {
        display: none;
    }

    .portfolio {
        display: block;
        max-width: 100%;
        height: auto;
        column-gap: 24px;
        row-gap: 48px;
    }

    .section-portfolio {
        padding-top: 96px;
        padding-bottom: 96px;
    }

    .section-portfolio {
        background-color: var(--color-hero);
    }

    .portfolio-list {
        max-width: 100%;
        height: auto;
        padding-top: 42px;

    }

    .portfolio-name {
        font-size: 20px;
        font-weight: 500;
        line-height: 1.2; /* 120% */
        letter-spacing: 0.02em;
        color: var(--color-primary);
        margin-bottom: 8px;
    }

    .portfolio-description {
        line-height: 1.5; /* 150% */
        letter-spacing: 0.02em;
    }

    .portf {
        padding: 32px 16px;
        border: 1px solid #e7e9fc;
        border-top: none;
    }
}

@media screen and (min-width: 768px) {
    .overlay {
        display: none;
    }

    .portfolio {
        flex-wrap: wrap;
        display: flex;
        gap: 48px 24px;

    }

    .section-portfolio {
        background-color: var(--color-hero);
        padding-top: 72px;
    }

    .portfolio-dark {
        display: block;
        max-width: 100%;
        height: auto;
    }

    .portfolio-list {
        width: calc((100% - 72px) / 2);

    }

    .portfolio-name {
        font-size: 20px;
        font-weight: 500;
        line-height: 1.2; /* 120% */
        letter-spacing: 0.02em;
        color: var(--color-primary);
        margin-bottom: 8px;
    }

    .portfolio-description {
        line-height: 1.5; /* 150% */
        letter-spacing: 0.02em;
    }

    .portf {
        padding: 32px 16px;
        border: 1px solid #e7e9fc;
        border-top: none;
    }
}

@media screen and (min-width: 1168px) {
    .portfolio {
        flex-wrap: wrap;
        display: flex;
        column-gap: 24px;
        row-gap: 48px;
    }

    .section-portfolio {
        padding-top: 120px;
        padding-bottom: 120px;
    }

    .section-portfolio {
        background-color: var(--color-hero);
    }

    .portfolio-list {
        width: calc((100% - 48px) / 3);
        transition: box-shadow 250ms cubic-bezier(0.4, 0, 0.2, 1);
    }

    .portfolio-list:hover .overlay,
    .portfolio-list:focus .overlay {
        transform: translateY(0%);
    }

    .portfolio-dark {
        position: relative;
        overflow: hidden;
    }

    .overlay {
        display: block;
        font-size: 16px;
        line-height: 1.5; /* 150% */
        letter-spacing: 0.02em;
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        color: var(--color-light);
        padding: 40px 32px;
        background-color: var(--color-brand);
        transform: translateY(100%);
        transition: transform 250ms cubic-bezier(0.4, 0, 0.2, 1);
    }

    .portfolio-name {
        font-size: 20px;
        font-weight: 500;
        line-height: 1.2; /* 120% */
        letter-spacing: 0.02em;
        color: var(--color-primary);
        margin-bottom: 8px;
    }

    .portfolio-description {
        line-height: 1.5; /* 150% */
        letter-spacing: 0.02em;
    }

    .portf {
        padding: 32px 16px;
        border: 1px solid #e7e9fc;
        border-top: none;
    }
}
